import React from "react";
export default function Offer()
{
    return(
        <>
        <section className="offer_bg">
       <div className="container py-5">
       <div className="row">
       <div className="col-md-4">
       <h1>We Offer Clean Cars For Everyone</h1>
       </div>
       </div>
       </div>
       </section> 
        </>
    )
}
